{"version":3,"sources":["webpack://metronic/../demo1/src/js/pages/crud/forms/widgets/bootstrap-maxlength.js"],"names":[],"mappings":";;;;;AAAA;;AAEA;;AAEA;AACA;AACA;AACA;AACA;AACA;AACA,SAAS;;AAET;AACA;AACA;AACA;AACA;AACA,SAAS;;AAET;AACA;AACA;AACA;AACA;AACA;AACA,SAAS;;AAET;AACA;AACA;AACA;AACA;AACA;AACA;AACA;AACA;AACA,SAAS;;AAET;AACA;AACA;AACA;AACA;AACA,SAAS;;AAET;AACA;AACA;AACA;AACA;AACA;AACA;AACA,SAAS;;AAET;AACA;AACA;AACA;AACA;AACA;AACA,SAAS;;AAET;AACA;AACA;AACA;AACA;AACA;AACA,SAAS;;AAET;AACA;AACA;AACA;AACA;AACA;AACA,SAAS;;AAET;;AAEA;AACA;AACA;AACA;AACA;AACA,SAAS;;AAET;AACA;AACA;AACA;AACA;AACA;AACA,SAAS;;AAET;AACA;AACA;AACA;AACA;AACA;AACA;AACA,SAAS;;AAET;AACA;AACA;AACA;AACA;AACA;AACA;AACA;AACA;AACA;AACA,SAAS;AACT;;AAEA;AACA;AACA;AACA;AACA;AACA;AACA,CAAC;;AAED;AACA;AACA,CAAC","file":"js/pages/crud/forms/widgets/bootstrap-maxlength.js","sourcesContent":["// Class definition\r\n\r\nvar KTBootstrapMaxlength = function () {\r\n\r\n    // Private functions\r\n    var demos = function () {\r\n        // minimum setup\r\n        $('#kt_maxlength_1').maxlength({\r\n            warningClass: \"label label-warning label-rounded label-inline\",\r\n            limitReachedClass: \"label label-success label-rounded label-inline\"\r\n        });\r\n\r\n        // threshold value\r\n        $('#kt_maxlength_2').maxlength({\r\n            threshold: 5,\r\n            warningClass: \"label label-warning label-rounded label-inline\",\r\n            limitReachedClass: \"label label-success label-rounded label-inline\"\r\n        });\r\n\r\n        // always show\r\n        $('#kt_maxlength_3').maxlength({\r\n            alwaysShow: true,\r\n            threshold: 5,\r\n            warningClass: \"label label-danger label-rounded label-inline\",\r\n            limitReachedClass: \"label label-primary label-rounded label-inline\"\r\n        });\r\n\r\n        // custom text\r\n        $('#kt_maxlength_4').maxlength({\r\n            threshold: 3,\r\n            warningClass: \"label label-danger label-rounded label-inline\",\r\n            limitReachedClass: \"label label-success label-rounded label-inline\",\r\n            separator: ' of ',\r\n            preText: 'You have ',\r\n            postText: ' chars remaining.',\r\n            validate: true\r\n        });\r\n\r\n        // textarea example\r\n        $('#kt_maxlength_5').maxlength({\r\n            threshold: 5,\r\n            warningClass: \"label label-danger label-rounded label-inline\",\r\n            limitReachedClass: \"label label-primary label-rounded label-inline\"\r\n        });\r\n\r\n        // position examples\r\n        $('#kt_maxlength_6_1').maxlength({\r\n            alwaysShow: true,\r\n            threshold: 5,\r\n            placement: 'top-left',\r\n            warningClass: \"label label-danger label-rounded label-inline\",\r\n            limitReachedClass: \"label label-primary label-rounded label-inline\"\r\n        });\r\n\r\n        $('#kt_maxlength_6_2').maxlength({\r\n            alwaysShow: true,\r\n            threshold: 5,\r\n            placement: 'top-right',\r\n            warningClass: \"label label-success label-rounded label-inline\",\r\n            limitReachedClass: \"label label-primary label-rounded label-inline\"\r\n        });\r\n\r\n        $('#kt_maxlength_6_3').maxlength({\r\n            alwaysShow: true,\r\n            threshold: 5,\r\n            placement: 'bottom-left',\r\n            warningClass: \"label label-warning label-rounded label-inline\",\r\n            limitReachedClass: \"label label-primary label-rounded label-inline\"\r\n        });\r\n\r\n        $('#kt_maxlength_6_4').maxlength({\r\n            alwaysShow: true,\r\n            threshold: 5,\r\n            placement: 'bottom-right',\r\n            warningClass: \"label label-danger label-rounded label-inline\",\r\n            limitReachedClass: \"label label-primary label-rounded label-inline\"\r\n        });\r\n\r\n        // Modal Examples\r\n\r\n        // minimum setup\r\n        $('#kt_maxlength_1_modal').maxlength({\r\n            warningClass: \"label label-warning label-rounded label-inline\",\r\n            limitReachedClass: \"label label-success label-rounded label-inline\",\r\n            appendToParent: true\r\n        });\r\n\r\n        // threshold value\r\n        $('#kt_maxlength_2_modal').maxlength({\r\n            threshold: 5,\r\n            warningClass: \"label label-danger label-rounded label-inline\",\r\n            limitReachedClass: \"label label-success label-rounded label-inline\",\r\n            appendToParent: true\r\n        });\r\n\r\n        // always show\r\n        // textarea example\r\n        $('#kt_maxlength_5_modal').maxlength({\r\n            threshold: 5,\r\n            warningClass: \"label label-danger label-rounded label-inline\",\r\n            limitReachedClass: \"label label-primary label-rounded label-inline\",\r\n            appendToParent: true\r\n        });\r\n\r\n        // custom text\r\n        $('#kt_maxlength_4_modal').maxlength({\r\n            threshold: 3,\r\n            warningClass: \"label label-danger label-rounded label-inline\",\r\n            limitReachedClass: \"label label-success label-rounded label-inline\",\r\n            appendToParent: true,\r\n            separator: ' of ',\r\n            preText: 'You have ',\r\n            postText: ' chars remaining.',\r\n            validate: true\r\n        });\r\n    }\r\n\r\n    return {\r\n        // public functions\r\n        init: function() {\r\n            demos();\r\n        }\r\n    };\r\n}();\r\n\r\njQuery(document).ready(function() {\r\n    KTBootstrapMaxlength.init();\r\n});\r\n"],"sourceRoot":""}